iterations.yara_rule:
rule Bypass_Sample
{
    meta:
        description = "EAX Test Bypass"
        version = "1.0"
        patterns:
            - pattern0: {6A ?? 5A 8B CE E8 ?? ??:?}
            - pattern1: {FF7508 ?? 83 C4 E8 ?? ??:?}
            - pattern2: {6A ?? 5A 8B CE ??:? 8B 45 85 C0}
    patterns:
        pattern0, pattern1, pattern2
}

rule Bypass_Sample
{
    meta:
        description = "Evasion bypass patterns targeting specific instruction sequences"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { 8B EC E8 ?? ?? ?? ?? FF 43 ?? }
        $pattern1 = { E8 C1 ?? ?? ?? ?? 0F 85 ?? ?? ?? ?? }
        $pattern2 = { 6A ?? 5A 8B CE E8 ?? ?? ?? ?? 85 C0 }

    condition:
        any of them
}

rule Bypass_Sample
{
    meta:
        description = "Evasion bypass rule targeting specific address calls"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { E8 ?? 06 4E 39 FF C7 }
        $pattern1 = { FF ?? ??.CE.1C000.E8 }
        $pattern2 = { 6A ?? 5A 8B CE E8 }

    condition:
        any of them
}

